import React from "react";
import messages from "../../../img/icon_messages.png";
import style from "../Navbar.module.css";

const Messages = () => {
    return (
        <div>
            <a><img className={style.img} src={messages} alt="messages"/></a>
        </div>
    );
}

export default Messages;
